package mhtml

import (
	"encoding/base64"
	"fmt"
	"testing"
)

func TestParsing(t *testing.T) {
	m := New()
	var logxml = ""
	mine, err := getMHtmlFromLog(logxml)
	if err != nil {
		t.Errorf("base64 decode ERROR %v", err.Error())
	}

	err = m.Parse(mine)
	if err != nil {
		t.Errorf("parsing mine ERROR %v", err.Error())
	}

	if m.boundary != "----=_NextPart_000_3E0F_9DFE9458.D3FADCE4" {
		t.Errorf("paring boundary failed")
	}
}

func getMHtmlFromLog(logxml string) ([]byte, error) {
	mhtml, err := base64.StdEncoding.DecodeString(logxml)
	if err != nil {
		fmt.Printf("'mhtml' base64 decode error : %v\n", err.Error())
		return nil, err
	}
	return mhtml, nil
}
